const new_items = [];
const tempdata = [];

// Get static data stored with the workflow
const dataprev = $getWorkflowStaticData("node");
const lastExecution = dataprev.lastExecution || [];

//for (let i = items.length - 1; i >= 0; i--) {
for (let i = 0; i < items.length; i++) {

    tempdata.push(items[i].json.booking_ref);
	// Check if data is already present
	if (lastExecution.includes(items[i].json.booking_ref)) {
		//break;
		continue;
	} else {
		// if new data then add it to an array
		new_items.push({
			json: {
				newcheck: items[i].json.booking_ref,
				booking_ref_no: items[i].json.ref_no,
                city_id: items[i].json.city,
                member_id: items[i].json.user_id,
                member_uuid: items[i].json.member_uuid,
                member_name: items[i].json.guess_name,
                booking_start: items[i].json.request_start,
				booking_end: items[i].json.request_end,
				booking_days: items[i].json.booking_days,
				vehicle_brand: items[i].json.vehicle_brand,
				vehicle_model: items[i].json.vehicle_model,
				vehicle_type: items[i].json.vehicle_type,
				vehicle_transmission: items[i].json.car_transmission,
				listing_id: items[i].json.listing_id,
				base_price: items[i].json.base_price,
                driverless_allowed: items[i].json.driver_type
			},
		});
	}
}

dataprev.lastExecution=tempdata;

// return new items
return new_items;
